import React, { Component } from 'react';
import PostForm from './PostForm';



export default class UpdatePost extends Component {
  render() {
    return (
      <PostForm />
    )
  }
}



const NEW_POST = gql`
 mutation createPost($title: String!, $body: String! ) {
   createPost(data: {
    status: PUBLISHED
     title: $title
     body:  $body
   }) {
     title
     body
     id
   }
 }
`
